SELECT , ,
FROM rgdb."DbV2002Fuka" as "DbT2002Fuka" INNER JOIN rgdb."DbT2003Kibetsu" AS "DbT2003Kibetsu" ON "DbT2002Fuka"."choteiNendo" = "DbT2003Kibetsu"."choteiNendo" AND "DbT2002Fuka"."fukaNendo" = "DbT2003Kibetsu"."fukaNendo" AND "DbT2002Fuka"."tsuchishoNo" = "DbT2003Kibetsu"."tsuchishoNo" AND "DbT2002Fuka"."rirekiNo" = "DbT2003Kibetsu"."rirekiNo" INNER JOIN rgdb."UrT0705ChoteiKyotsu" AS "UrT0705ChoteiKyotsu" ON "DbT2003Kibetsu"."choteiId" = "UrT0705ChoteiKyotsu"."choteiId" INNER JOIN "FuchoKarisanteiTemp" AS "FuchoKarisanteiTemp" ON "FuchoKarisanteiTemp"."hihokenshaNo" = "DbT2002Fuka"."hihokenshaNo" WHERE "DbT2002Fuka"."fukaNendo" = #{賦課前年度}
AND "DbT2002Fuka"."choteiNendo" = #{調定前年度}
ORDER BY "DbT2002Fuka"."hihokenshaNo" , "DbT2002Fuka"."tsuchishoNo" DESC

WITH master as( SELECT , , , "ShinkiShikakuTaishoTemp"."tsuchishoNo" as "shinkiShikakuTaishoTemp_tsuchishoNo", "SortTemp"."choshuHoho" AS "SortTemp_choshuHoho", "SortTemp"."tkKaishiM" AS "SortTemp_tkKaishiM" FROM rgdb."DbT2015KeisangoJoho" AS "DbT2015KeisangoJoho" INNER JOIN rgdb."UeT0511NenkinTokuchoKaifuJoho" AS "UeT0511NenkinTokuchoKaifuJoho" ON "DbT2015KeisangoJoho"."kariNenkinNo" = "UeT0511NenkinTokuchoKaifuJoho"."kisoNenkinNo" AND "DbT2015KeisangoJoho"."kariNenkinCode" = "UeT0511NenkinTokuchoKaifuJoho"."nenkinCode" AND "DbT2015KeisangoJoho"."kariHosokuM" = "UeT0511NenkinTokuchoKaifuJoho"."hosokuTsuki" LEFT JOIN "FukaZenNendoTemp" AS "FukaZenNendoTemp" ON "DbT2015KeisangoJoho"."hihokenshaNo" = "FukaZenNendoTemp"."hihokenshaNo" LEFT JOIN "ShinkiShikakuTaishoTemp" AS "ShinkiShikakuTaishoTemp" ON "ShinkiShikakuTaishoTemp"."tsuchishoNo" = "DbT2015KeisangoJoho"."tsuchishoNo" LEFT JOIN "SortTemp" AS "SortTemp" ON "SortTemp"."tsuchishoNo" = "DbT2015KeisangoJoho"."tsuchishoNo" WHERE "DbT2015KeisangoJoho"."choteiNendo" = #{調定年度} AND "DbT2015KeisangoJoho"."fukaNendo" = #{賦課年度} AND "DbT2015KeisangoJoho"."koseiZengoKubun" = '2' AND "DbT2015KeisangoJoho"."sakuseiShoriName" = #{作成処理名} AND "UeT0511NenkinTokuchoKaifuJoho"."tsuchiNaiyoCode" in ( #{特別徴収対象者情報} , #{特別徴収追加候補者情報} ) AND "UeT0511NenkinTokuchoKaifuJoho"."shoriNendo" = #{調定前年度} ) SELECT master.*,
FROM master INNER JOIN rgua."UaFt200FindShikibetsuTaisho"('','',false,'DB',false,'','','','','','','','','','','',true, '','','','','','','',true,'','','','','','','','','','','',true,true,true,true,true,true,true,true,true,true, true,'','','','','','','','',true,'','',true,true,true,'','','','','','','','','','','','','','','','','','', ( SELECT ARRAY_AGG(CAST (master."dbT2015KeisangoJoho_shikibetsuCode" AS TEXT)) FROM master ) ) AS "ShikibetsuTaisho" ON "master"."dbT2015KeisangoJoho_shikibetsuCode" = "ShikibetsuTaisho"."shikibetsuCode"
